import initialState from "./initialState"
import TypeAction from "../../constants/index"

export const home = (state=initialState.login, action) => {
    switch(action.type){
        case TypeAction.LOGIN:
            return {
                ...state,
                login: action.payload,
            }
        default:
            return state;
    }
}
